import React from "react";
import Faworite from "../Components/Ffaworit";
import Mmore from "../Components/Mmore";


const Favorite = ()=>{
    let data=[]
    for(let i=0;i<localStorage.length;i++){
        data.push(JSON.parse(localStorage.getItem(localStorage.key(i))));
        console.log(data[i]);
        return (
            <>
            <div>
                <Faworite key={data[i].id} item={data[i]}/>
                </div>
            </>
        )
    }
    
}

export {Favorite}
